import React from "react"
import styled from "@emotion/styled"

const toggleDrawerButton = (props) => {
  const ToggleButton = styled.button`
    height: 24px;
  `
  const ToggleButtonLine = styled.div``

  return (
    <ToggleButton>
      <ToggleButtonLine />
      <ToggleButtonLine />
      <ToggleButtonLine />
    </ToggleButton>
  )
}

export default toggleDrawerButton
